import React, {Component} from 'react';

class Home extends Component
{
    render()
    {
        return(
            <div>
                <h1>Welcome to your hotel!</h1>
                <p>Please log into your account or create an account if you don't have one!</p>
            </div>
        )
    }
}

export default Home;
